import React from 'react';
import ReactAnimatedWeather from 'react-animated-weather';

const WeatherIconTwo = props => {
  if (!props.icon) {
    return `Loading...`;
  }

  console.log(props.icon);

  return <div>WeatherIcon: {props.icon}</div>;
};

export default WeatherIconTwo;
